static object *
varref (object * lenv, pxll_int depth, pxll_int index) {
  while (depth--) {
    lenv = (object*)lenv[1];
  }
  return (object*)lenv[index+2];
}

static void
varset (object * lenv, pxll_int depth, pxll_int index, object * val) {
  while (depth--) {
    lenv = (object*)lenv[1];
  }
  lenv[index+2] = val;
}

